//When the send button is clicked
    public void send(View v){
        //get message from message box
        String nama = jaksaTextField.getText().toString();
        String nip = jaksaNipField.getText().toString();
        String pengaduan = pengaduanTextField.getText().toString();

        //check whether the msg empty or not
        if(nama.length()>0 && nip.length()>0 && pengaduan.length()>0) {
            Toast.makeText(getBaseContext(),"Pengaduan " + pengaduan, Toast.LENGTH_SHORT).show();

            HttpClient httpclient = new DefaultHttpClient();
            HttpPost httppost = new HttpPost("http://surabayajobfair.com/meta/httpDemo.php");

            try {
                List<NameValuePair> params = new ArrayList<NameValuePair😠2);
                params.add(new BasicNameValuePair("nama", nama));
                params.add(new BasicNameValuePair("nip", nip));
                params.add(new BasicNameValuePair("pengaduan", pengaduan));

                httppost.setEntity(new UrlEncodedFormEntity(params, "UTF-8"));
                //Execute and get the response.
                HttpResponse response = httpclient.execute(httppost);
                HttpEntity entity = response.getEntity();

                // pengaduanTextField.setText(""); //reset the message text field
                // Toast.makeText(getBaseContext(),"Sent",Toast.LENGTH_SHORT).show();

                BufferedReader rd = new BufferedReader(new InputStreamReader(entity.getContent()));
                String line = "";
                while ((line = rd.readLine()) != null) {
                    System.out.println(line);
                }
            } catch (IOException e) {
                e.printStackTrace();
            }

        }else {
            //display message if text field is empty
            Toast.makeText(getBaseContext(),"All fields are required",Toast.LENGTH_SHORT).show();
        }
    }

public MyImage getImageByKD(String id_pohon) {
SQLiteDatabase db = this.getReadableDatabase();

Cursor cursor = db.query(TABLE_IMAGE, new String[] { KEY_ID,
KEY_IDPOHON, KEY_IMAGE_PATH, KEY_ID_ANGLE, KEY_DATE}, KEY_IDPOHON + "=?",
new String[] { String.valueOf(id_pohon) }, null, null, null, null);
if (cursor != null)
cursor.moveToFirst();

MyImage image = new MyImage(Integer.parseInt(cursor.getString(0)),
cursor.getString(1), cursor.getString(2), cursor.getString(3), cursor.getString(4));
// return image
return image;
}


